// src/pages/Home.js

import React from 'react';
import { Link } from 'react-router-dom';
import { FaSignInAlt, FaUserPlus } from 'react-icons/fa';
import styles from './Home.module.css';

const Home = () => {
  return (
    <div className={styles.homepage}>
      <header className={styles.header}>
        <h1 className={styles.title}>ProjectReserva</h1>
        <p className={styles.subtitle}>Your go-to platform for booking bus tickets hassle-free!</p>
      </header>
      <div className={styles.options}>
        <Link to="/login" className={`${styles.option} ${styles.authOption}`}>
          <FaSignInAlt size={40} />
          <span>Login</span>
        </Link>
        <Link to="/register" className={`${styles.option} ${styles.authOption}`}>
          <FaUserPlus size={40} />
          <span>Register</span>
        </Link>
      </div>
    </div>
  );
};

export default Home;
